import { newE2EPage } from '@stencil/core/testing';
describe('hmc-toast-message', () => {
  it('renders', async () => {
    const page = await newE2EPage();
    await page.setContent('<hmc-toast-message></hmc-toast-message>');
    const element = await page.find('hmc-toast-message');
    expect(element).toHaveClass('hydrated');
  });
});
